// src/pages/Tutor/TutorHome.jsx
import React, { useEffect, useState } from 'react';
import { Container, Card, ListGroup, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import api from '../../services/api';

const formatDateTime = iso =>
  new Date(iso).toLocaleString('pt-BR', {
    day   : '2-digit',
    month : '2-digit',
    year  : 'numeric',
    hour  : '2-digit',
    minute: '2-digit',
    second: '2-digit',
  });

export default function TutorHome() {
  const navigate = useNavigate();
  const [pets, setPets] = useState([]);
  const [selectedPet, setSelectedPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    const tut = JSON.parse(localStorage.getItem('usuario_tutor'));
    if (!tut) return navigate('/login-tutor');
    api.defaults.headers.common['Authorization'] = `Bearer ${tut.token}`;

    api.get(`/pets?tutor=${tut._id}`)
      .then(({data}) => setPets(data))
      .catch(console.error);

    api.get(`/eventos/tutor/${tut._id}`)
      .then(({data}) => setEventos(data))
      .catch(console.error);
  }, [navigate]);

  useEffect(() => {
    const tut = JSON.parse(localStorage.getItem('usuario_tutor'));
    if (!tut) return;
    if (selectedPet === null) {
      api.get(`/eventos/tutor/${tut._id}`)
        .then(({data}) => setEventos(data))
        .catch(console.error);
    } else {
      api.get(`/eventos/pet/${selectedPet}`)
        .then(({data}) => setEventos(data))
        .catch(console.error);
    }
  }, [selectedPet]);

  const handleCheckIn = () => {
    if (!selectedPet) return;
    navigate(`/pets/${selectedPet}/novo-evento`);
  };

  const handleCheckOut = id => {
    api.put(`/eventos/${id}/checkout`, { dataSaida: new Date().toISOString() })
      .then(({data}) => {
        setEventos(evts =>
          evts.map(e => e._id === id
            ? {...e, dataSaida: data.dataSaida, status: data.status}
            : e
          )
        );
      })
      .catch(() => alert('Falha no check-out'));
  };

  return (
    <Container className="mt-4">
      <div className="d-flex justify-content-between mb-3">
        <h2>Painel do Tutor</h2>
        <Button variant="secondary" onClick={() => navigate('/')}>Sair</Button>
      </div>
      <div className="d-flex">
        <Card style={{ width: 220 }} className="me-4">
          <Card.Header>Meus Pets</Card.Header>
          <ListGroup variant="flush">
            <ListGroup.Item action active={selectedPet===null} onClick={()=>setSelectedPet(null)}>
              Todos Pets
            </ListGroup.Item>
            {pets.map(p => (
              <ListGroup.Item key={p._id} action active={p._id===selectedPet}
                onClick={()=>setSelectedPet(p._id)}>
                {p.nome}
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Card>
        <Card className="flex-fill">
          <Card.Header className="d-flex justify-content-between">
            <span>Meus Eventos</span>
            <Button variant="success" size="sm"
              onClick={handleCheckIn} disabled={!selectedPet}>
              Check-in
            </Button>
          </Card.Header>
          <ListGroup variant="flush">
            {eventos.length===0 && (
              <ListGroup.Item>Nenhum evento registrado.</ListGroup.Item>
            )}
            {eventos.map(evt=>(
              <ListGroup.Item key={evt._id} className="d-flex justify-content-between">
                <div>
                  <strong>{evt.tipo}</strong> â€”<br/>
                  Entrada: {formatDateTime(evt.dataEntrada)}<br/>
                  SaÃ­da: {evt.dataSaida?formatDateTime(evt.dataSaida):'â€”'}<br/>
                  Status: {evt.status}
                </div>
                {!evt.dataSaida && (
                  <Button variant="warning" size="sm"
                    onClick={()=>handleCheckOut(evt._id)}>
                    Check-out
                  </Button>
                )}
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Card>
      </div>
    </Container>
  );
}
